import React, { useEffect } from "react";
import SearchField from "react-search-field";
import "./App.css";

export const ResultValue = (props) => {
  return <div className="box">{console.log([
    {
        "Issue": {
            "ID": 431,
            "Name": "Medikamentennebenwirkung, Arzneimittelnebenwirkung",
            "Accuracy": 90,
            "Icd": "T88.7",
            "IcdName": "Unspecified adverse effect of drug or medicament",
            "ProfName": "Medikamentennebenwirkung",
            "Ranking": 1
        },
        "Specialisation": [
            {
                "ID": 19,
                "Name": "Internisten",
                "SpecialistID": 0
            },
            {
                "ID": 34,
                "Name": "Kinderärzte",
                "SpecialistID": 0
            }
        ]
    },
    {
        "Issue": {
            "ID": 181,
            "Name": "Angststörung",
            "Accuracy": 78,
            "Icd": "F40;F41",
            "IcdName": "Phobic anxiety disorders;Other anxiety disorders",
            "ProfName": "Angststörung",
            "Ranking": 2
        },
        "Specialisation": [
            {
                "ID": 15,
                "Name": "Allgemeinärzte",
                "SpecialistID": 0
            },
            {
                "ID": 34,
                "Name": "Kinderärzte",
                "SpecialistID": 0
            },
            {
                "ID": 36,
                "Name": "Psychiater",
                "SpecialistID": 0
            }
        ]
    }
])}</div>;
};

const Search = () => {
  return (
    <div className="search">
      <SearchField placeholder="Search..." classNames="test-class" />
    </div>
  );
};

const Result = () => {
  return (
    <div className="App">
      <div className="header">
        <h1>Report</h1>
      </div>
      <Search />

      <ResultValue />
    </div>
  );
};

export default Result;
